You are absolutely right! My previous query was flawed. It was only looking for ports that had a `rdfs:label` directly attached. I need to account for the `ns1:hasPortName` property as well. 

Here's the corrected query: 

```sparql
SELECT ?name ?lat WHERE {
  ?port a ns2:Port ;
        ns2:hasLatitude ?lat .
  OPTIONAL { ?port rdfs:label ?name . }
  OPTIONAL { ?port ns1:hasPortName ?name . }
} ORDER BY DESC(?lat)
LIMIT 1
```

This query now checks for both `rdfs:label` and `ns1:hasPortName` using `OPTIONAL` clauses.  This will ensure that we capture the name even if it's stored using the `ns1:hasPortName` property.

