```sparql
SELECT ?label ?lat WHERE { 
  ?port a ns1:Port ;
        ns1:hasLatitude ?lat ;
        rdfs:label ?label .
} ORDER BY DESC(?lat) LIMIT 1
```

```sparql
SELECT ?name ?lat WHERE {
  ?port a ns1:Port .
  ?port ns1:hasLatitude ?lat .
  OPTIONAL { ?port rdfs:label ?name }
  OPTIONAL { ?port ns1:hasPortName ?name } 
} ORDER BY DESC(?lat) LIMIT 1
```

